  "\"\u3069\u3046\u3082Y.K\u3067\u3059\u3002\\n6\u6708\u4e2d\u65ec\u306b\u306a\u308a\u3001\u6691\u3044\u65e5\u3082\u591a\u304f\u306a\u3063\u3066\u304d\u307e\u3057\u305f\u306d\u3002\\n\u5317\u6d77\u9053\u3067\u3082\u6c17\u6e29\u304c30\u5ea6\u3092\u8d85\u3048\u305f\u308a\u3001\u4eca\u5e74\u306f\u51b7\u590f\u3060\u3068\u8a00\u308f\u308c\u3066\u3082\u81ea\u5206\u306f\u4e2d\u3005\u4fe1\u3058\u3089\u308c\u306a\u304b\u3063\u305f\u308a\u3057\u307e\u3059\u3002\\n\u3055\u3066\u3001\u3053\u306e\u590f\u3092\u697d\u3057\u304f\u4e57\u308a\u5207\u308b\u306e\u306b\u30aa\u30b9\u30b9\u30e1\u306a\u306e\u304c\u91d1\u9b5a\u3067\u3059\uff01\\n\u610f\u5916\u3068\u30da\u30c3\u30c8\u30b7\u30e7\u30c3\u30d7\u306e\u4e2d\u306f\u6dbc\u3057\u3044\u306e\u3067\u3001\u6687\u3064\u3076\u3057\u304c\u3066\u3089\u8997\u3044\u3066\u3044\u304f\u306e\u3082\u697d\u3057\u3044\u3067\u3059\u3002\\n\u3054\u5b58\u77e5\u306e\u65b9\u3082\u591a\u3044\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u304c\u3001\u91d1\u9b5a\u306f\u4e2d\u56fd\u3067\u30d5\u30ca\u306e\u7a81\u7136\u5909\u7570\u7a2e\u3001\u7dcb\u9b92\u3092\u6539\u826f\u3057\u305f\u3082\u306e\u3067\u3059\u3002\\n\u306a\u306e\u3067\u3001\u3061\u3083\u3093\u3068\u7ba1\u7406\u3092\u3057\u306a\u3044\u3068\u91d1\u9b5a\u306f\u5143\u306e\u30d5\u30ca\u306b\u623b\u3063\u3066\u3057\u307e\u3046\u306e\u3067\u3059\u3002\\n\u91d1\u9b5a\u306e\u7a2e\u985e\u306f100\u7a2e\u985e\u4ee5\u4e0a\u3042\u308a\u3001\u4e2d\u56fd\u3067\u751f\u307e\u308c\u305f\u3082\u306e\u3084\u65e5\u672c\u3067\u751f\u307e\u308c\u305f\u3082\u306e\u7b49\u69d8\u3005\u3067\u3059\u3002\\n\u751f\u304d\u7269\u3067\u3042\u308a\u306a\u304c\u3089\u30a4\u30f3\u30c6\u30ea\u30a2\u3068\u3057\u3066\u98fe\u3063\u3066\u3082\u7dba\u9e97\u3067\u3059\u3088\u306d\u3002\\n\u91d1\u9b5a\u306f\u79c1\u81ea\u8eab\u3082\u597d\u304d\u3067\u3001\u30a4\u30e9\u30b9\u30c8\u306e\u30e2\u30c1\u30fc\u30d5\u306b\u3057\u305f\u3053\u3068\u304c\u3042\u308a\u307e\u3059\u3002\\n\u3061\u306a\u307f\u306b\u3053\u3093\u306a\u611f\u3058\u3067\u3059\u3002