  \u6d0b\u697d\u30a2\u30fc\u30c6\u30a3\u30b9\u30c8\u306f\u30d1\u30d1\u30ed\u30fc\u30c1\u304c\u597d\u304d\u3067\u3059\\n-\\n\u58f0\u304c\u6700\u9ad8\\n\u3086\u305a\u3001superfly\u304c\u5927\u597d\u304d\u3067\u3059(
  ^w^ )\\n\u3068\u304f\u306b\u6b4c\u5531\u529b\u306e\u3042\u308b\u3072\u3068\u306b\u60f9\u304b\u308c\u307e\u3059\uff01\\n\u3086\u305a\u306f\u6b4c\u8a5e\u304c\u3088\u304f\u3066\u3001\u5143\u6c17\u304c\u3067\u307e\u3059\uff3c(^o^)\uff0f\\nsuperfly\u306f\u58f0\u304c\u597d\u304d\u306a\u306e\u3067\u203c\ufe0e
  -\\njuju\\nFM\u3092\u805e\u3044\u3066\u305f\u3089 juju\u3055\u3093\u30ab\u30d0\u30fc\u306eHelloAgain\uff08\u305d\u306e\u5148\u306e\u30bf\u30a4\u30c8\u30eb\u77e5\u3089\u306a\u3044\u3093\u3067\u3059\uff09\u304c\u6d41\u308c\u3066
