  \u7d0d\u5f97\u3067\u3059\u3002 -\\n\u30ad\u30b9\u30de\u30a4 3\u4eba\\n\u79c1\u3082\u30ad\u30b9\u30de\u30a4\u5927\u597d\u304d\u2606\u3067\u3059\u3002\\n\u7389\u3061\u3083\u3093,\u307f\u3063\u304f\u3093,\u592aP\u304c\u597d\u304d\u3067\u3059\u3002\\n\u7389\u3061\u3083\u3093\u306f\u7279\u306b\u5927\u597d\u304d\u2606\u3067\u3059\u3002\\n\u300c\u7f8e\u7537\u3067\u3059\u306d\u3002\u300d\u306e\u6642\u304b\u3089\u306a\u306e\u3067\u3001\u307e\u3060\u30d5\u30a1\u30f3\u6b74\u306f3\u5e74\u3067\u6d45\u3044\u3067\u3059\u304c\u3001live\u306f\u4eca\u306e\u3068\u3053\u308d\u884c\u3051\u3066\u307e\u3059(^^)v\\n\u4eca\u5e74\u3082\u884c\u3051\u308b\u3068\u826f\u3044\u306a\u3041\u2026
