  AND MARY\\n\u66f2\u304c\u53ef\u611b\u3089\u3057\u304f\u3066...\u4eca\u3067\u3082\u597d\u304d\u3067\u3059\u3002\\n\u89e3\u6563\u30e9\u30a4\u30d6\u306b\u4e00\u7dd2\u306b\u53c2\u6226\u3057\u305f\u53cb\u9054\u3068\u3001\u3044\u3064\u304b\u3042\u308b\u3067\u3042\u308d\u3046\u518d\u7d50\u6210\u30e9\u30a4\u30d6\u3082\u4e00\u7dd2\u306b\u884c\u3053\u3046\u3068\u7d04\u675f\u3057\u3066\u307e\u3059\u3002\\n\u3042\u3068\u3001\u6700\u8fd1\u3067\u306f\u30bb\u30ab\u30aa\u30ef\u3002\\n\u606f\u5b50\u306e\u5f71\u97ff\u3067\u3059\uff08\u2267\u2207\u2266\uff09\\n-\\n\u304d\u3059\u307e\u3044only\\n\u30ad\u30b9\u30de\u30a4\u3067\u3059\u3063\u3063(\u03c3*\u00b4\u2200\uff40)\\n\u4e2d\u3067\u3082\u305f\u3044\u3074\u30fc\u304c\uff11\u756a\u597d\u304d\u3067\u3059(\u7b11)
  -\\nEXILE\\n\u826f\u3044\u6b4c\u8a5e\u306a\u306e\u3067\u3001\u5143\u6c17\u306b\u306a\u308a\u307e\u3059\u3002\\n\u30a2\u30c4\u30b7\u306e\u58f0\u304c\u597d\u304d\u3067\u3059
  -\\n\u79c1\u306f\u5d50\uff01\uff01\\n\u79c1\u306f\u5d50\uff2c\uff2f\uff36\uff25\u3067\u3059\\n\u304b\u3063\u3053\u3044\u3044\u753b\u50cf\u3082\u898b\u3064\u3051\u307e\u3057\u305f\u266a\\n\u3061\u306a\u307f\u306b\u3001\u5d50\u306e\u4e2d\u3067\u3082\u7279\u306b\u7fd4\u304f\u3093\uff2c\uff2f\uff36\uff25\u3067\u3059
  -\\n\uff33\uff25\uff2b\uff21\uff29\uff2e\uff2f\uff2f\uff37\uff21\uff32\uff29\uff01\\n\u30d0\u30f3\u30c9\u3067\u3082\u3042\u308b\u3051\u3069\u3001\u6b4c\u624b\u3067\u3082\u3042\u308b\uff01\\n\u72ec\u7279\u306e\u6b4c\u8a5e\u3001\u4e16\u754c\u89b3\u3001\u305d\u308c\u304b\u3089\u6df1\u702c\u306e\u6b4c\u58f0\u304c\u66f2\u3068\u30de\u30c3\u30c1\u3057\u3066\u3044\u3066\u4f55\u56de\u805e\u3044\u3066\u3082\u3042\u304d\u306a\u3044\u304b\u3089\uff01\\n-\\n10\u4ee3\u2026\u3068\u306a\u308b\u3068\u3001\u77e5\u3089\u306a\u3044\u3001\u304b\u306a\u3041\uff1f\\n\u3044\u3084\u300110\u4ee3\u3067\u306a\u304f\u3066\u3082\u77e5\u3089\u306a\u3044\u53ef\u80fd\u6027\u304c(\u309c_\u309c;)\\n\u89d2\u677e\u654f\u751f\u3067\u3059\u203c\\n\u65e6\u90a3\u306e\u5f71\u97ff\u3067\u306f\u3042\u308a\u307e\u3059\u304c\u3001\\n\u79c1\u3082\u597d\u304d\u306b\u306a\u308a\u307e\u3057\u305f\uff01\\n\u6bce\u56de\u592b\u5a66\u3067\u30e9\u30a4\u30d6\u306b\u884c\u304d\u307e\u3059\u304c\u3001\\n\u3081\u3061\u3083\u3081\u3061\u3083\u697d\u3057\u3044\u3067\u3059\u266a\\n-\\n\u30b3\u30a2\u3067\u3059\u304c\u30fb\u30fb\uff08\uff3e\uff3e\uff1b\uff09\\n\u6749\u5c71\u6e05\u9686\u3055\u3093\u304c\u5927\u597d\u304d\u3067\u3059\u3002\\n\uff75\uff92\uff76\uff9e\u6642\u4ee3\u304b\u3089\u306e\u30d5\u30a1\u30f3\u3067\u3059\u3002\\n\u6bce\u65e5\u6d77\u3092\u89b3\u306a\u304c\u3089\u304c\u8074\u3044\u3066\\n\u4ed5\u4e8b\u3057\u3066\u304a\u308a\u307e\u3059\u3002\\n-\\n\u5d50\u3082\u597d\u304d\u3067\u3059\u304c\u95a2\u30b8\u30e3\u30cb\u221e\u304c\u4e00\u756a\u597d\u304d\u3067\u3059\u3002(*\u2267\u2200\u2266*)\\n\u5d50\u3082\u95a2\u30b8\u30e3\u30cb\u221e\u3082\u30b3\u30f3\u30b5\u30fc\u30c8\u3001\u30b0\u30c3\u30ba\u8cb7\u3044\u306b\u884c\u3051\u306a\u3044\u3093\u3067\u30b3\u30f3\u30b5\u30fc\u30c8\u30b0\u30c3\u30ba\u306f\u30cd\u30c3\u30c8\u901a\u8ca9\u3067\u8cb7\u3063\u305f\u95a2\u30b8\u30e3\u30cb\u221e\u306e\u30dd\u30c1\u888b\u3060\u3051\u6301\u3063\u3066\u307e\u3059\u3002\\n\u597d\u304d\u3059\u304e\u3066\u30af\u30ed\u30fc\u30bc\u30c3\u30c8\u306e\u4e2d\u306f\u30bb\u30d6\u30f3\u30a4\u30ec\u30d6\u30f3\u3068\u95a2\u30b8\u30e3\u30cb\u221e\u306e\u30b3\u30e9\u30dc\u5546\u54c1\u3092\u98fe\u3063\u3066\u307e\u3059\u3002(^_^;)\\n\u95a2\u30b8\u30e3\u30cb\u221e\u306fCD\u3001DVD\u304c\u307b\u307c\u6bce\u56de3\u7a2e\u985e\u51fa\u308b\u3057\u3001\u30e1\u30f3\u30d0\u30fc\u306e\u51fa\u6f14\u3057\u305f\u30c9\u30e9\u30de\u3084\u6620\u753b\u306eDVD\u3082\u8cb7\u3063\u3066\u3066\u3001\u4eca\u56de\u306e\u30bb\u30d6\u30f3\u30b3\u30e9\u30dc\u3082\u8cb7\u3063\u3066\u3001\u96d1\u8a8c\u3082\u8cb7\u3063\u3066\u3067\u304a\u91d1\u304c\u304b\u304b\u308a\u3059\u304e\u3066\u8caf\u91d1\u304c\u6e1b\u308b\u4e00\u65b9\u3067\u3059\u3002(ToT)\\n\u305d\u308c\u3067\u3082\u95a2\u30b8\u30e3\u30cb\u221e\u95a2\u9023\u306e\u5546\u54c1\u306f\u8cb7\u308f\u305a\u306b\u306f\u3044\u3089\u308c\u307e\u305b\u3093\u3002(^_^;)\\n\u753b\u50cf\u306f\u79c1\u306e\u90e8\u5c4b\u306e\u30af\u30ed\u30fc\u30bc\u30c3\u30c8\u3067\u3059\u3002\"",
  "\"\u3088\u3046\u3053\u305d\u3001\u30b2\u30b9\u30c8\u3055\u3093\\n\u6700\u8fd1\u306f\u3088\u304f\u306a\u3063\u3066\u304d\u307e\u3057\u305f\u304c\u3001\u79c1\u306f\u6bcd\u3086\u305a\u308a\u306e\u30a2\u30ec\u30eb\u30ae\u30fc\u6301\u3061\u3067\u3059\u3002\u30c0\u30cb\u3068\u82b1\u7c89\u306b\u5f31\u304f\u3066\u3001\u5c0f\u5b66\u751f\u306e\u3053\u308d\u306f\u3088\u304f\u5168\u8eab\u304c\u30ab\u30b5\u30ab\u30b5\u306b\u306a\u3063\u3066\u3044\u307e\u3057\u305f\u3002\u3053\u306e\u4f53\u8cea\u304c\uff18\u6b73\u306e\u5a18\u306b\u3082\u73fe\u308c\u305f\u3089\u56f0\u308b\u306e\u3067\u3001\u53bb\u5e74\u306e\uff16\u6708\u304b\u3089\u3053\u306e\u30c0\u30cb\u6355\u308a\u30de\u30c3\u30c8\u3092\u30d9\u30c3\u30c9\u3067\u4f7f\u3046\u3053\u3068\u306b\u3057\u307e\u3057\u305f\u3002\\n\u4eca\u56de\u306e\u53d6\u6750\u306e\u304a\u96fb\u8a71\u304c\u3042\u3063\u305f\u3068\u304d\u306b\u3001\u4f7f\u7528\u6e08\u307f\u30de\u30c3\u30c8\u3092\u56de\u53ce\u3057\u3066\u6355\u308c\u305f\u30c0\u30cb\u306e\u6570\u3092\u6570\u3048\u3066\u6559\u3048\u3066\u3044\u305f\u3060\u3051\u308b\u3053\u3068\u306b\u306a\u308a\u307e\u3057\u305f\u3002\\n\u590f\u306e\u7d42\u308f\u308a\u306b\u3055\u3063\u305d\u304f\u304a\u9001\u308a\u3057\u305f\u3089\u3001\uff14\u30f5\u6240\u3067\u306a\u3093\u30681560\u5339\u3082\uff01\u3057\u304b\u3082\u5a18\u3068\u79c1\u304c\u3044\u3063\u3057\u3087\u306b\u5bdd\u3066\u3044\u308b\u30d9\u30c3\u30c9\u3060\u3051\u304b\u3089900\u5339\u4ee5\u4e0a\u3082\u6355\u308c\u3066\u3044\u305f\u306e\u3067\u3059\u3002\u30b7\u30e7\u30c3\u30af\u3067\u3057\u305f\u3002\u3053\u3093\u306a\u306b\u5927\u91cf\u306e\u30c0\u30cb\u304c\u3044\u305f\u3089\u3001\u3044\u3064\u5a18\u306b\u30a2\u30ec\u30eb\u30ae\u30fc\u306e\u75c7\u72b6\u304c\u51fa\u3066\u3082\u304a\u304b\u3057\u304f\u306a\u3044\u3058\u3083\u306a\u3044\u3067\u3059\u304b\u3002\u30be\u30c3\u3068\u3057\u307e\u3057\u305f\u3002\\n\u3053\u308c\u3092\u30d9\u30c3\u30c9\u30d1\u30c3\u30c9\u306e\u4e0b\u306b\u4f7f\u3046\u3088\u3046\u306b\u306a\u3063\u3066\u304b\u3089\u306f\u3001\u305f\u3057\u304b\u306b\u79c1\u306e\u9f3b\u708e\u3082\u843d\u3061\u7740\u3044\u3066\u304d\u307e\u3057\u305f\u3002\u3068\u304f\u306b\u53bb\u5e74\u306f\u3044\u3064\u3082\u9f3b\u708e\u304c\u3072\u3069\u304f\u306a\u308b\u79cb\u53e3\u306b\u3082\u75c7\u72b6\u304c\u843d\u3061\u7740\u3044\u3066\u3044\u305f\u306e\u3067\u3001\u3053\u306e\u30de\u30c3\u30c8\u304c\u30c0\u30cb\u3092\u6355\u3063\u3066\u304f\u308c\u3066\u3044\u308b\u3093\u3060\u306a\u3068\u611f\u3058\u3066\u3044\u307e\u3057\u305f\u3002\\n\u3054\u5b58\u77e5\u306e\u3088\u3046\u306b\u3001\u5598\u606f\u3084\u30a2\u30c8\u30d4\u30fc\u6027\u76ae\u819a\u708e\u3068\u3044\u3063\u305f\u5c0f\u5150\u30a2\u30ec\u30eb\u30ae\u30fc\u306e\u539f\u56e0\u7269\u8cea\uff08\u30a2\u30ec\u30eb\u30b2\u30f3\uff09\u306e\u4ee3\u8868\u683c\u304c\u30c0\u30cb\u306e\u7cde\u3084\u6b7b\u9ab8\u3067\u3059\u3002\\n\u3044\u3061\u3070\u3093\u6709\u52b9\u306a\u30a2\u30ec\u30eb\u30ae\u30fc\u5bfe\u7b56\u306f\u539f\u56e0\u7269\u8cea\u3092\u6e1b\u3089\u3059\u3053\u3068\u3067\u3059\u304c\u3001\u751f\u304d\u305f\u30c0\u30cb\u306f\u7e4a\u7dad\u306b\u3057\u304c\u307f\u3064\u304f\u529b\u304c\u5f37\u3044\u3046\u3048\u306b\u3001\u5e03\u56e3\u3084\u30bd\u30d5\u30a1\u306e\u4e2d\u306b\u5165\u308a\u8fbc\u3093\u3067\u3044\u305f\u308a\u3059\u308b\u306e\u3067\u3001\u6383\u9664\u6a5f\u3067\u306f\u306a\u304b\u306a\u304b\u6355\u308a\u304d\u308c\u307e\u305b\u3093\u3002\\n\u305d\u3053\u3067\u79c1\u305f\u3061\u304c\u30c0\u30cb\u6355\u308a\u306e\u30d4\u30ab\u30a4\u30c1\u3068\u4fe1\u3058\u3066\u3044\u308b\u306e\u304c\u672c\u54c1\u3067\u3059\u3002\\n\uff08\uff11\uff09\u77f3\u6cb9\u7cfb\u306e\u6bba\u866b\u5264\uff08\u6709\u6a5f\u6eb6\u5264\uff09\u306f\u4e00\u5207\u4f7f\u308f\u305a\u306b\u3001\u30c0\u30cb\u304c\u5927\u597d\u304d\u306a22\u7a2e\u306e\u5929\u7136\u30a8\u30b5\u306e\u9999\u308a\u3067\u30de\u30c3\u30c8\u306e\u4e2d\u306b\u8a98\u3044\u8fbc\u3080\u3002\\n\uff08\uff12\uff09\u30a8\u30b5\u306b\u306f\u5438\u6e7f\u6027\u30bb\u30e9\u30df\u30c3\u30af\u7c89\u672b\u3092\u6df7\u305c\u3066\u3042\u308b\u306e\u3067\u3001\u3053\u308c\u3092\u98df\u3079\u305f\u30c0\u30cb\u306f\u8131\u6c34\u75c7\u72b6\u3092\u8d77\u3053\u3057\u3066\u6570\u65e5\u3067\u4e7e\u71e5\u3057\u3066\u3057\u307e\u3046\u3002\\n\uff08\uff13\uff09\uff13\u30f5\u6708\u306e\u4f7f\u7528\u671f\u9593\u306e\u3042\u3068\u306f\u3001\u30de\u30c3\u30c8\u3054\u3068\u71c3\u3048\u308b\u30b4\u30df\u3068\u3057\u3066\u6368\u3066\u3089\u308c\u308b\u306e\u3067\u3001\u5ba4\u5185\u306b\u30c0\u30cb\u306e\u6b7b\u9ab8\u3084\u7cde\u304c\u6b8b\u3089\u306a\u3044\u3002\\n\u30c0\u30cb\u306e\u5bff\u547d\u306f\u304a\u3088\u305d\uff13\u30f5\u6708\u3068\u8a00\u308f\u308c\u3066\u3044\u307e\u3059\u304c\u3001\u653e\u3063\u3066\u304a\u304f\u3068\u7206\u767a\u7684\u306b\u7e41\u6b96\u3059\u308b\u306e\u3067\u3001\u3064\u306d\u306b\u6355\u7372\u3057\u7d9a\u3051\u308b\u3053\u3068\u304c\u5927\u5207\u3067\u3059\u3002\\n\u7de8\u96c6\u90e8\u3067\u306f\u6bce\u5e74\u3001\u590f\u306e\u7d42\u308f\u308a\u306b\u9577\u671f\u4f7f\u7528\u8005\u304b\u3089\u4f7f\u7528\u6e08\u307f\u30de\u30c3\u30c8\u3092\u9001\u3063\u3066\u3044\u305f\u3060\u3044\u3066\u3001\u5c02\u9580\u6a5f\u95a2\u3067\u6355\u7372\u3057\u305f\u30c0\u30cb\u306e\u6570\u3092\u30ab\u30a6\u30f3\u30c8\u3057\u3066\u3044\u307e\u3059\u3002\u6628\u5e74\u306f\u53f3\u8868\u306e10\u4eba\u306e\u4f7f\u7528\u6e08\u307f\u30de\u30c3\u30c8\u3092\u30ab\u30a6\u30f3\u30c8\u3057\u305f\u3068\u3053\u308d\u3001\\n\u25cf
  \u524d\u5e74\u3088\u308a\u3082\u5897\u3048\u305f\u2026\u2026\u2026\u2026\uff15\u4eba\\n\u25cf
  \u524d\u5e74\u3088\u308a\u6e1b\u3063\u305f\u2026\u2026\u2026\u2026\u2026\uff15\u4eba\\n\u6bce\u5e74\u3001\u8a08\u6e2c\u7d50\u679c\u3092\u30c1\u30a7\u30c3\u30af\u3057\u3066\u3044\u305f\u3060\u3044\u3066\u3044\u308b\u30c0\u30cb\u30a2\u30ec\u30eb\u30ae\u30fc\u7814\u7a76\u306e\u7b2c\u4e00\u4eba\u8005\u3067\u3042\u308b\u9808\u85e4\u5343\u6625\u5148\u751f\uff08\u5143\u4e2d\u90e8\u5927\u5b66\u5fdc\u7528\u751f\u7269\u5b66\u90e8\u6559\u6388\uff09\u306f\u3001\\n\u300c\u30c0\u30cb\u306f\u6c17\u6e2925\u301c27\u2103\u3001\u6e7f\u5ea675\uff05\u306e\u3068\u304d\u306b\u7206\u767a\u7684\u306b\u7e41\u6b96\u3057\u307e\u3059\u3002\u8863\u985e\u306b\u3064\u3044\u3066\u5916\u304b\u3089\u5ba4\u5185\u306b\u6301\u3061\u8fbc\u307e\u308c\u308b\u30b1\u30fc\u30b9\u3082\u591a\u3044\u306e\u3067\u3001\u30c0\u30cb\u5bfe\u7b56\u306f\u3044\u3061\u3069\u6355\u308c\u3070\u304a\u3057\u307e\u3044\u3068\u3044\u3046\u3053\u3068\u306b\u306f\u306a\u308a\u307e\u305b\u3093\u3002\u6bce\u5e74\u7d9a\u3051\u3066\u3044\u304f\u3053\u3068\u304c\u5927\u5207\u3067\u3059\u300d\\n\u7c98\u7740\u30c6\u30fc\u30d7\u5f0f\u306e\u7af6\u5408\u54c1\u3082\u51fa\u3066\u304d\u307e\u3057\u305f\u304c\u3001\u672c\u54c1\u306fNPO\u6cd5\u4eba\u300c\u5fdc\u7528\u751f\u7269\u79d1\u5b66\u7814\u7a76\u6240\u300d\u30c0\u30cb\u90e8\u4f1a\u306b\u6240\u5c5e\u3059\u308b\u65e5\u9769\u7814\u7a76\u6240\u306e\u6e21\u9089\u79c0\u592b\u3055\u3093\u304c\u958b\u767a\u3057\u305f\u7279\u8a31\u88fd\u54c1\u3067\u3059\u3002\\n\u5f15\u51fa\u3057\u7528\u306e\u300c\u5c0f\u300d\u3068\u306e\u30bb\u30c3\u30c8\u3082\u3042\u308a\u307e\u3059\u3002\\n\u203b\u590f\u5b63\u306e\uff13\u30f5\u6708\u4f7f\u7528\u3057\u305f\u30c0\u30cb\u6355\u308a\u30de\u30c3\u30c8\uff08\u5927\uff09\u3067\u30ab\u30a6\u30f3\u30c8\u3002\\n\uff08\u4e00\u8ca1\u30fb\u30dc\u30fc\u30b1\u30f3\u54c1\u8cea\u8a55\u4fa1\u6a5f\u69cb\u8abf\u3079\uff09\\n\u203b\u300e\u30c0\u30cb\u6355\u308a\u30de\u30c3\u30c8
  \u3053\u308c\u304c\u5143\u7956\u3060\u300f\u3067\u6355\u308c\u308b\u306e\u306f\u3001\\n\u5ba4\u5185\u306b\u751f\u606f\u3059\u308b\u30c1\u30ea\u30c0\u30cb\u3068\u30c4\u30e1\u30c0\u30cb\u3067\u3059\u3002\"",
  "\"\u8868\u60c5\u3092\u3055\u3089\u306b\u5f15\u304d\u7acb\u3066\u308b\u3001\u808c\u8272\u30fb\u5b63\u7bc0\u30fb\u96f0\u56f2\u6c17\u30fb\u30c8\u30ec\u30f3\u30c9\u3092\u898b\u6975\u3081\u305f\u3001\u30aa\u30ea\u30b8\u30ca\u30eb\u30ab\u30e9\u30fc\u304cAsh\u3067\u898b\u3064\u304b\u308b\uff01
  | \u3053\u3060\u308f\u308a\u7279\u96c6Ash \u4e45\u304c\u539f\u5e97(\u30a2\u30c3\u30b7\u30e5)\\n\u4e45\u304c\u539f\u99c51\u5206\u2606\u5f53\u65e5\u4e88\u7d04OK\u2606\u5e74\u959311,000\u540d\u4ee5\u4e0a\u306e\u5b9f\u7e3e\u3042\u308a\u3002\u30ab\u30c3\u30c8\u304c\u4e0a\u624b\u3067\u30d8\u30c3\u30c9\u30b9\u30d1\u304c\u81ea\u6162\u306e\u30b5\u30ed\u30f3\\n(8\u4ef6)\\n-
  \u6280\u8853\uff1a4.9\\n- \u30b5\u30fc\u30d3\u30b9\uff1a4.8\\n- \u96f0\u56f2\u6c17\uff1a4.7\\n-
  \u30dd\u30a4\u30f3\u30c8\u304c\u8caf\u307e\u308b\u30fb\u4f7f\u3048\u308b\\n- \u30e1\u30f3\u30ba\u6b53\u8fce\\n\u3054\u4e88\u7d04\u30fb\u304a\u554f\u3044\u5408\u308f\u305b\\n\u96fb\u8a71\u4e88\u7d04\u306f\u30dd\u30a4\u30f3\u30c8\u5229\u7528\u30fb\u4ed8\u4e0e\u5bfe\u8c61\u5916\u3067\u3059\\nAsh
  \u4e45\u304c\u539f\u5e97\u306e\u3053\u3060\u308f\u308a\u7279\u96c6\\n- \u30ab\u30e9\u30fc\\n-
  \u30ea\u30bf\u30c3\u30c1\\n\u8868\u60c5\u3092\u3055\u3089\u306b\u5f15\u304d\u7acb\u3066\u308b\u3001\u808c\u8272\u30fb\u5b63\u7bc0\u30fb\u96f0\u56f2\u6c17\u30fb\u30c8\u30ec\u30f3\u30c9\u3092\u898b\u6975\u3081\u305f\u3001\u30aa\u30ea\u30b8\u30ca\u30eb\u30ab\u30e9\u30fc\u304cAsh\u3067\u898b\u3064\u304b\u308b\uff01\\n\u30ab\u30c3\u30c8+\u30ab\u30e9\u30fc\u304c\u5927\u4eba\u6c17\u266a\u8272\u6301\u3061\u3084\u767a\u8272\u306e\u826f\u3055\u306b\u3082\u3053\u3060\u308f\u308a\u4e0a\u8cea\u306a\u85ac\u5264\u3092\u53d6\u6271\u3046Ash\uff01\\n\u30c8\u30ec\u30f3\u30c9\u30ab\u30e9\u30fc\u3084\u30ca\u30c1\u30e5\u30e9\u30eb\u7cfb\u3084\u30a2\u30c3\u30b7\u30e5\u7cfb\u306a\u3069\u30d0\u30ea\u30a8\u30fc\u30b7\u30e7\u30f3\u3082\u8c4a\u5bcc\u3002\u5b9a\u671f\u7684\u306a\u30e1\u30f3\u30c6\u30ca\u30f3\u30b9\u3001\u30ab\u30e9\u30fc\u3092\u3053\u307e\u3081\u306b\u5909\u3048\u305f\u3044\u65b9\u306a\u3069\u3001\u304a\u8ca1\u5e03\u306b\u512a\u3057\u3044\u4fa1\u683c\u3082\u25ce\\n\u30c0\u30e1\u30fc\u30b8\u3092\u8efd\u6e1b\u3055\u305b\u306a\u304c\u3089\u5747\u4e00\u306b\u30ab\u30e9\u30fc\u30ea\u30f3\u30b0\u3057\u3001\u304a\u5ba2\u69d8\u306e\u3042\u3063\u305f\u30d1\u30fc\u30bd\u30ca\u30eb\u30ab\u30e9\u30fc\u3092\u3054\u63d0\u6848\u3055\u305b\u3066\u3044\u305f\u3060\u304d\u307e\u3059\u3002\\nAsh
