  "\"\u3010\u990a\u7236\u5e02\u3067\u683c\u5b89\u846c\u5100\u304c119000\u5186\u3011\u5b89\u3044\u846c\u5100\u6599\u91d1\u306e\u6bd4\u8f03\u306a\u3089\u30b3\u30b3!!\\n\u846c\u5100\u306e\u8cbb\u7528\u306f\u3001\u5168\u56fd\u5e73\u5747\u3067120\u4e07\u5186\u304c\u4e00\u822c\u7684\u306a\u76f8\u5834\u3068\u8a00\u308f\u308c\u3066\u3044\u307e\u3059\u3002\\n\u846c\u5100\u696d\u8005\u3055\u3093\u306b\u3088\u3063\u3066\u3001\u6700\u8fd1\u306f\u304b\u306a\u308a\u5024\u6bb5\u304c\u9055\u3063\u3066\u3044\u307e\u3059\u300210\u4e07\u5186\u524d\u5f8c\u306e\u706b\u846c\u306e\u307f\u3059\u308b\u30bf\u30a4\u30d7\u304b\u3089\u3001\u846c\u5100\u5834\u3067\u306e\u304a\u901a\u591c\u3001\u544a\u5225\u5f0f\u3092\u884c\u3046\u30bf\u30a4\u30d7\u307e\u3067\u3002\\n\u990a\u7236\u5e02\u3067\u306e\u846c\u5100\u3092\u5c11\u3057\u3067\u3082\u5b89\u304f\u3067\u304d\u306a\u3044\u304b\u3068\u304a\u63a2\u3057\u306e\u65b9\u306b\u5f79\u7acb\u3064\u60c5\u5831\u3092\u3054\u7d39\u4ecb\u3057\u3066\u3044\u307e\u3059\u3002\\n\u4ea1\u304f\u306a\u3089\u308c\u3066\u3059\u3050\u306e\u65b9\u3067\u6025\u3044\u3067\u554f\u3044\u5408\u308f\u305b\u3055\u308c\u305f\u3044\u65b9\u306f\u3001\u3053\u3061\u3089\u304c\u304a\u3059\u3059\u3081\\n-
