  \u3088\u308a\u305d\u3046\u304a\u846c\u5f0f\u304a\u554f\u3044\u5408\u308f\u305b\u2192\\n-
  \u846c\u5100\u30ca\u30d3(\u4e00\u62ec\u898b\u7a4d)\u304a\u554f\u3044\u5408\u308f\u305b\u2192\\n\u3067\u306e\u304a\u554f\u3044\u5408\u308f\u305b\u3067\u3001\u307e\u305a\u306f\u5024\u6bb5\u3092\u78ba\u8a8d\u3055\u308c\u3066\u307f\u308b\u3068\u3001\u540c\u3058\u846c\u5100\u306e\u5185\u5bb9\u3067\u3082\u304b\u306a\u308a\u5024\u6bb5\u304c\u9055\u3046\u3053\u3068\u304c\u5206\u304b\u308a\u307e\u3059\u3002\\n\u846c\u5100\u306e\u30bf\u30a4\u30d7\u3068\u76f8\u5834\\n\u6700\u8fd1\u306e\u846c\u5100\u3068\u3057\u3066\u3001\u4e3b\u306b\u4ee5\u4e0b\u306e\u3088\u3046\u306a\u30bf\u30a4\u30d7\u304c\u3042\u308a\u307e\u3059\u3002\u4e00\u822c\u7684\u306a\u5024\u6bb5\u306e\u76f8\u5834\u3082\u8abf\u3079\u3066\u307f\u307e\u3057\u305f\u3002\\n\u3053\u308c\u4ee5\u5916\u306b\u3082\u3001\u75c5\u9662\u306a\u3069\u304b\u3089\u3054\u81ea\u5b85\u3084\u846c\u5100\u4f1a\u5834\u307e\u3067\u306e\u3054\u907a\u4f53\u642c\u9001\u8cbb\u7528\u3001\u706b\u846c\u5834\u306e\u706b\u846c\u8cbb\u7528\u3001\u304a\u574a\u3055\u3093\u306e\u8cbb\u7528\u306a\u3069\u304c\u5225\u9014\u304b\u304b\u308a\u307e\u3059\u3002\\n\u6700\u8fd1\u3067\u306f\u3001\u846c\u5100\u5834\u3067\u884c\u3046\u3053\u3068\u304c\u591a\u3044\u306e\u3067\u3059\u304c\u3001\u81ea\u5b85\u846c\u306e\u5834\u5408\u306b\u306f\u3001\u796d\u58c7\u306e\u6e96\u5099\u306a\u3069\u3067\u5225\u9014\u8cbb\u7528\u304c\u639b\u304b\u308b\u5834\u5408\u3082\u3042\u308a\u307e\u3059\u3002\\n\u796d\u58c7\u306e\u5927\u304d\u3055\u3001\u970a\u67e9\u8eca\u306e\u7a2e\u985e\u3001\u30bf\u30af\u30b7\u30fc\u3084\u30de\u30a4\u30af\u30ed\u30d0\u30b9\u306a\u3069\u706b\u846c\u5834\u3078\u306e\u79fb\u52d5\u306e\u969b\u306e\u4ea4\u901a\u624b\u6bb5\u3001\u4f1a\u846c\u8005\u3078\u306e\u4f1a\u846c\u5fa1\u793c\u3084\u9999\u5178\u8fd4\u3057\u306e\u624b\u914d\u306a\u3069\u3082\u5225\u9014\u8cbb\u7528\u304c\u304b\u304b\u308a\u307e\u3059\u3002\\n\u6545\u4eba\u306e\u751f\u524d\u306e\u5e0c\u671b\u3067\u3001\u7c21\u7d20\u306a\u846c\u5100\u306b\u3057\u305f\u3044\u5834\u5408\u306f\u3001\u706b\u846c\u5f0f\u304c\u4e00\u756a\u7c21\u7d20\u3067\u8cbb\u7528\u3082\u4f4e\u304f\u6291\u3048\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u4f1a\u793e\u306e\u53d6\u5f15\u5148\u306a\u3069\u306e\u95a2\u4fc2\u3082\u3042\u3063\u3066\u3001\u4e00\u822c\u846c\u3067\u884c\u3046\u5834\u5408\u3067\u3082\u3001\u846c\u5100\u696d\u8005\u3055\u3093\u3067\u304b\u306a\u308a\u8cbb\u7528\u304c\u9055\u3044\u307e\u3059\u306e\u3067\u3001\u5fc5\u305a\u8907\u6570\u306e\u898b\u7a4d\u3082\u308a\u3092\u3082\u3089\u3063\u3066\u304b\u3089\u691c\u8a0e\u3055\u308c\u308b\u3053\u3068\u3092\u304a\u3059\u3059\u3081\u3057\u307e\u3059\u3002\\n\u5b9f\u969b\u306b\u898b\u7a4d\u3082\u308a\u3092\u3082\u3089\u3063\u3066\u307f\u308b\u3068\u3001\u5bb6\u65cf\u846c\u3067\u3082\u68fa\u306e\u4ee3\u91d1\u304c20,000\u5186\u306e\u3068\u3053\u308d\u3082\u3042\u308c\u307035,000\u5186\u306e\u3068\u3053\u308d\u3082\u3042\u3063\u305f\u308a\u3001\u796d\u58c7\u306e\u8cbb\u7528\u306f\u30b3\u30df\u30b3\u30df\u3067\u3082\u796d\u58c7\u306e\u904b\u642c\u8cbb\u7528\u304c\u5fc5\u8981\u3060\u3063\u305f\u308a\u3001\u846c\u5100\u306e\u30b9\u30bf\u30c3\u30d5\u304c2\u540d\u304b3\u540d\u304b\u3067\u5024\u6bb5\u3082\u304b\u306a\u308a\u9055\u3063\u3066\u304d\u305f\u308a\u3057\u307e\u3059\u3002\\n\u7dcf\u984d\u306b\u3059\u308b\u3068\u3001\u5bb6\u65cf\u846c\u3084\u4e00\u822c\u846c\u306a\u308915\u4e07\u304b\u308920\u4e07\u5186\u7a0b\u5ea6\u306e\u958b\u304d\u304c\u3042\u308a\u307e\u3059\u306e\u3067\u3001\u846c\u5100\u4f1a\u793e\u3055\u3093\u306e\u6bd4\u8f03\u306f\u7d76\u5bfe\u306b\u5fc5\u8981\u3067\u3059\u3002\\n\u990a\u7236\u5e02\u306e\u706b\u846c\u6599\u91d1\u306f25,000\u5186\\n\u846c\u5100\u8cbb\u7528\u3092\u6291\u3048\u305f\u3044\u65b9\u306b\u304a\u3059\u3059\u3081\u306e\u30d7\u30e9\u30f3\u3067\u3059\u304c\u3001\u8ffd\u52a0\u3067\u8cbb\u7528\u304c\u767a\u751f\u3059\u308b\u5834\u5408\u3082\u3042\u308a\u307e\u3059\u3002\u990a\u7236\u5e02\u5185\u3067\u846c\u5100\u3092\u884c\u308f\u308c\u308b\u65b9\u3067\u3001\u990a\u7236\u5e02\u306e\u706b\u846c\u5834\u3092\u5229\u7528\u3055\u308c\u308b\u6642\u306b\u306f\u5225\u9014\u846c\u5100\u8cbb\u7528\u304c\u5fc5\u8981\u306a\u5834\u5408\u3082\u3042\u308a\u307e\u3059\u3002\\n\u4ea1\u304f\u306a\u3089\u308c\u305f\u65b9\u304c\u300c\u990a\u7236\u5e02\u306e\u65b9\u300d\u3067\u3042\u308c\u3070\u706b\u846c\u8cbb\u7528\u306f25,000\u5186\u3067\u3059\u3002\u5e02\u5916\u306e\u65b9\u306f\u3001\u5225\u9014\u8cbb\u7528\u304c\u767a\u751f\u3057\u307e\u3059\u3002\u8a73\u3057\u304f\u306f\u3001\u990a\u7236\u5e02\u306e\u706b\u846c\u6599\u91d1\u306e\u30da\u30fc\u30b8\u3092\u3054\u89a7\u304f\u3060\u3055\u3044\u3002\\n\u4e00\u822c\u7684\u306b\u306f\u3001\u706b\u846c\u5834\u306f\u5e02\u533a\u753a\u6751\u306e\u81ea\u6cbb\u4f53\u304c\u904b\u55b6\u3057\u3066\u3044\u307e\u3059\u306e\u3067\u3001\u4f4f\u6c11\u767b\u9332\u3092\u3055\u308c\u3066\u3044\u308b\u65b9\u306f\u8ca0\u62c5\u304c\u4f4e\u304f\u3001\u5e02\u5916\u306e\u65b9\u306b\u306f\u5c11\u3057\u9ad8\u3081\u306b\u8a2d\u5b9a\u3055\u308c\u3066\u3044\u308b\u3068\u3053\u308d\u304c\u307b\u3068\u3093\u3069\u3067\u3059\u3002\\n\u846c\u5100\u4f1a\u793e\u3055\u3093\u306e\u6599\u91d1\u6bd4\u8f03\\n\u3053\u306e\u30da\u30fc\u30b8\u3067\u3082\u3001\u304a\u554f\u3044\u5408\u308f\u305b\u304c\u591a\u3044\u306e\u306f\u3001\u4ee5\u4e0b\u306e\u846c\u5100\u5c4b\u3055\u3093\u3067\u3059\u3002\\n\u554f\u3044\u5408\u308f\u305b\u306e\u969b\u306f\u3001\u5fc5\u305a\u4ee5\u4e0b\u306e\u9805\u76ee\u30c1\u30a7\u30c3\u30af\u3092\u304a\u5fd8\u308c\u306a\u304f\u3002\\n-
  \u68fa\u3001\u796d\u58c7\u3001\u5e03\u56e3\u3001\u30c9\u30e9\u30a4\u30a2\u30a4\u30b9\u306a\u3069\u306e\u8cbb\u7528\\n-
  \u81ea\u5b85\u3084\u75c5\u9662\u304b\u3089\u846c\u5100\u5834\u307e\u3067\u306e\u642c\u9001\u8cbb\u7528\\n-
  \u846c\u5100\u5834\u304b\u3089\u706b\u846c\u5834\u307e\u3067\u306e\u642c\u9001\u8cbb\u7528\\n-
