u304b\u3089\u4eca\u306e\u81ea\u5206\u3092\u898b\u305f\u3068\u304d\u3001\u61d0\u304b\u3057\u3044\u3068\u601d\u3048\u305d\u3046\u306a\u3089\u3070\u3001\u305d\u308c\u306f\u3042\u306a\u305f\u304c\u300c\u4eca\u3057\u304b\u306a\u3044\u77ac\u9593\u300d\u3092\u751f\u304d\u3066\u3044\u308b\u3068\u3044\u3046\u3053\u3068\u3067\u3042\u308a\u3001\u3042\u306a\u305f\u304c\u4eca\u3082\u306a\u304a\u5909\u5316\u3057\u6210\u9577\u3057\u3066\u3044\u308b\u8a3c\u62e0\u3067\u308b\u3002\\n\u4eca\u3092\u61d0\u304b\u3057\u3081\u308b\u3088\u3046\u306b\u751f\u304d\u308b\u3053\u3068\u3053\u305d\u3001\u4eca\u3092\u751f\u304d\u308b\u3068\u3044\u3046\u3053\u3068\u306a\u306e\u3060\u3002\\n\u4eca\u9031\u306e\u3044\u3061\u307e\u3044\\n\u30a2\u30d1\u30fc\u30c8\u8fd1\u304f\u306e\u795e\u793e\u304c\u304a\u796d\u308a\u4ed5\u69d8\u306b\u306a\u3063\u3066\u3044\u305f\u3002\u304a\u796d\u308a\u3063\u3066\u306a\u305c\u3060\u304b\u308f\u304b\u3089\u306a\u3044\u3051\u3069\u30ef\u30af\u30ef\u30af\u3057\u307e\u3059\u3088\u306d\u3002\\n\uff3c\u300e\u5171\u611f\u30a2\u30eb\u30b4\u30ea\u30ba\u30e0\u300f\u3067\u3001\u60f3\u3044\u3092\u4f1d\u3048\u3066\u307f\u307e\u305b\u3093\u304b\uff1f\uff0f\\n\u793e\u54e1\u3055\u3093\u306b\u3001\u4e16\u306e\u306a\u304b\u306b\u3001\u793e\u9577\u306e\u60f3\u3044\u3092\u5f62\u306b\u3057\u3066\u767a\u4fe1\u3057\u307e\u3059\u3002\u793e\u9577\u306e\u201c\u60f3\u3044\u201d\u306b\u201c\u8ad6\u7406\u201d\u3092\u52a0\u308f\u3048\u308b\u304b\u3089\u3001\u7d0d\u5f97\u611f\u304c\u5897\u3057\u3001\u6df1\u304f\u4f1d\u308f\u308b\u306e\u3067\u3059\u3002\\n\u8a73\u7d30\u3084\u304a\u7533\u3057\u8fbc\u307f\u306f\u4ee5\u4e0b\u306e\u30ea\u30f3\u30af\u304b\u3089\u3002\"",
  "\"\u3053\u306e\uff11\u5e74\u3092\u632f\u308a\u8fd4\u308a\u3001\u8272\u3093\u306a\u3053\u3069\u3082\u305f\u3061\u306b\u51fa\u4f1a\u3063\u305f\u3002\\n\u8a66\u884c\u932f\u8aa4\u306e\u30b1\u30a2\u306e\u4e2d\u3067\u3001\u79c1\u3082\u69d8\u3005\u306a\u3053\u3068\u3092\u77e5\u308a\u5b66\u3076\u3053\u3068\u304c\u3067\u304d\u305f\u3068\u611f\u3058\u3066\u3044\u308b\u3002\\n\u4f55\u3092\u77e5\u308a\u5b66\u3093\u3060\u304b\u3001\u96d1\u99c1\u3067\u306f\u3042\u308b\u304c\u307e\u3068\u3081\u3066\u304a\u304d\u305f\u3044\u3002\\n\u5916\u6765\u306b\u3084\u3063\u3066\u304f\u308b\u3053\u3069\u3082\u305f\u3061\u306e\u591a\u304f\u306f\u300c\u767a\u9054\u969c\u5bb3\u300d\u3067\u3042\u308b\u3053\u3068\u3092\u60a9\\n\u300c\u3068\u3082\u3060\u3061\u306b\u3044\u3058\u3081\u3089\u308c\u305f\u308a\u304b\u3089\u304b\u308f\u308c\u308b\u300d\\n\u300c\u3044\u3064\u3082\u6012\u3089\u308c\u308b\u300d\\n\u300c\u5206\u304b\u3063\u3066\u3044\u308b\u3053\u3068\u3092\u4f55\u5ea6\u3082\u3044\u308f\u308c\u308b\u300d\\n\u300c\u81ea\u5206\u306e\u8a71\u3092\u304d\u3044\u3066\u304f\u308c\u306a\u3044\u300d\\n\u306a\u3069\u3001\u81ea\u5206\u306e\u6c17\u6301\u3061\u3092\u300c\u308f\u304b\u3063\u3066\u3082\u3089\u3048\u306a\u3044\u300d\u3053\u3068\u306b\u60a9\u3093\u3067\u3044\u308b\u3002\\n\u304a\u3068\u306a\u3068\u3053\u3069\u3082\u306e\u60a9\u307f\u306b\u306f\u304b\u306a\u308a\u306e\u76f8\u9055\u304c\u3042\u308b\u3002\\n\u4f8b\u3048\u3070\u3001\u89aa\u306f\u3053\u3069\u3082\u304c\u300c\u52c9\u5f37\u3057\u306a\u3044\u3053\u3068\u300d\u306b\u3064\u3044\u3066\u60a9\u3093\u3067\u3044\u308b\u304c\\n\u3053\u3069\u3082\u306f\u89aa\u306b\u300c\u52c9\u5f37\u3057\u308d\u3068\u8a00\u308f\u308c\u7d9a\u3051\u3066\u30a6\u30b6\u3044\u300d\u3068\u3044\u3046\u3053\u3068\u306b\u60a9\u3093\\n\u89aa\u306f\u5c06\u6765\u306e\u3053\u3068\u3092\u898b\u636e\u3048\u305f\u60a9\u307f\u3067\u3042\u308b\u306e\u306b\u5bfe\u3057\u3001\u3053\u3069\u3082\u306f\u307e\u3055\u306b\u300c\\n\u554f\u984c\u3068\u307f\u306a\u3055\u308c\u308b\u69d8\u3005\u306a\u884c\u52d5\u8a00\u52d5\u306e\u80cc\u666f\u306b\u306f\u3001\u305f\u304f\u3055\u3093\u306e\u300c\u8a71\u305b\u306a\\n\u53f1\u3089\u308c\u3063\u3071\u306a\u3057\u306e\u3053\u3069\u3082\u305f\u3061\u306f\u3001\u3044\u3064\u3082\u884c\u52d5\u3067\u8a55\u4fa1\u6bd4\u8f03\u3055\u308c\u308b\u3053\u3068\\n\u304d\u3063\u3068\u3053\u3069\u3082\u305f\u3061\u306f\u300c\u8ab0\u3082\u4fe1\u7528\u3067\u304d\u306a\u3044\u300d\u300c\u4fe1\u3058\u305f\u4ffa\u304c\u30d0\u30ab\u3060\u3063\u305f\\n\u60a9\u3081\u308b\u3053\u3069\u3082\u305f\u3061\u306e\u3053\u3053\u308d\u306e\u4e2d\u306b\u306f\u3001\u4eca\u306b\u3082\u7815\u3051\u305d\u3046\u306a\u30b0\u30e9\u30b9\u304c\u5b58\u5728\u3057\u3066\u3044\u308b\u3002\\n\u305d\u306e\u4e2d\u306b\u3068\u3081\u3069\u306a\u304f\u6ce8\u304c\u308c\u308b\u30b9\u30c8\u30ec\u30b9\u306e\u6c34\u3002\u4eca\u306b\u3082\u6ea2\u308c\u305d\u3046\u3067\u5e38\u306b\u8868\u9762\u5f35\u529b\u3067\u8e0f\u3093\u5f35\u3063\u3066\u3044\u308b\u304b\u306e\u3088\u3046\u3067\u3042\u308b\u3002\\n\u3042\u308b\u6642\u306b\u3001\u4e00\u6ef4\u305d\u3053\u306b\u6c34\u304c\u6ce8\u304c\u308c\u308b\u3068\u3001\u77ac\u304f\u9593\u306b\u305d\u308c\u306f\u6f0f\u308c\u51fa\u3057\u6012\u308a\u3068\u6094\u3057\u3055\u3001\u60b2\u3057\u307f\u306e\u6d2a\u6c34\u306e\u4e2d\u3067\u82e6\u60a9\u3059\u308b\u3002\u4e00\u5ea6\u6ea2\u308c\u3060\u3057\u305f\u3089\u3082\u3046\u6b62\u3081\u3089\u308c\u306a\u3044\u3002\u305d\u3057\u3066\u30b0\u30e9\u30b9\u306f\u7815\u3051\u6563\u308b\u3002\\n\u7642\u80b2\u3092\u53d7\u3051\u3066\u3044\u308b\u304b\u3089\u3068\u3044\u3063\u3066\u5fc5\u305a\u3057\u3082\u793e\u4f1a\u9069\u5fdc\u304c\u3088\u304f\u306a\u308b\u308f\u3051\u3067\\n\u7642\u80b2\u3067\u76f8\u8ac7\u3059\u308b\u30b9\u30ad\u30eb\u3092\u305b\u3063\u304b\u304f\u8eab\u306b\u3064\u3051\u3066\u3082\u3001\u5468\u56f2\u304c\u8a71\u3092\u805e\u304b\u305a\\n\u7642\u80b2\u3067\u77e5\u3063\u305f\u3053\u3068\u3001\u5b66\u3093\u3060\u3053\u3068\u3001\u60a9\u3093\u3060\u3053\u3068\u306a\u3069\u3092\u3001\u307e\u305a\u306f\u89aa\u3084\u983c\\n\u7642\u80b2\u3068\u306f\u3001\u4e16\u77e5\u8f9b\u3044\u4e16\u306e\u4e2d\u3067\u751f\u304d\u3066\u3044\u304b\u306d\u3070\u306a\u3089\u306a\u3044\u305f\u3081\u306e\u300c\u51e6\u4e16\\n\u4e16\u306b\u51fa\u3066\u304b\u3089\u306e\u751f\u6d3b\u306e\u307b\u3046\u304c\u5727\u5012\u7684\u306b\u9577\u3044\u3068\u3044\u3046\u73fe\u5b9f\u3002\\n\u7642\u80b2\u3067\u5b66\u3093\u3060\u308a\u57f9\u3063\u305f\u308a\u3057\u305f\u3053\u3068\u306f\u3001\u793e\u4f1a\u306b\u5de3\u7acb\u3063\u3066\u304b\u3089\u69d8\u3005\u306a\u7d4c\\n\u4ee5\u4e0a\u306f\u3001\u81e8\u5e8a\u7d4c\u9a13\u306b\u57fa\u3065\u304f\u79c1\u898b\u3067\u3042\u308b\u3002\\n0
  \u4ef6\u306e\u30b3\u30e1\u30f3\u30c8:\\n\u30b3\u30e1\u30f3\u30c8\u3092\u6295\u7a3f\"",
